import { Injectable, NotFoundException } from '@nestjs/common';
import { PostsDto } from './dto/posts.dto';
import { v4 as uuid } from 'uuid';

@Injectable()
export class PostsService {
  private posts: PostsDto[] = [
    {
      id: uuid(),
      title: 'Obama is the new president',
      content: 'alskdflksadjflkajsdfjasldkfjalskjdflasjfdlasfjkasdfaksdmfasfd',
      imageUrl:
        'data:image/jpeg;base64,',
      tags: 'Obama',
    },
    {
      id: uuid(),
      title: 'Argentina is the world champion',
      content: 'alskdflksadjflkajsdfjasldkfjalskjdflasjfdlasfjkasdfaksdmfasfd',
      imageUrl:
        'data:image/jpeg;base64,',
      tags: 'World cup',
    },
    {
      id: uuid(),
      title: 'Ronaldo broke his leg',
      content: 'alskdflksadjflkajsdfjasldkfjalskjdflasjfdlasfjkasdfaksdmfasfd',
      imageUrl:
        'data:image/jpeg;base64,',
      tags: 'Ronaldo broken',
    },
  ];

  findAll() {
    return this.posts;
  }

  findById(id: string) {
    const post = this.posts.find((post) => post.id === id);
    if (!post) {
      throw new NotFoundException(`Post with id ${id} not found`);
    }
    return post;
  }

  createPost(postsDto: PostsDto) {
    this.posts.push(postsDto);

    return `Post "${postsDto.title}" creado con éxito`;
  }
}
